<script>
import axios from "axios";
const translations =
    {
        title: {
            en: 'Car report',
            ru: 'Отчет по автомобилю',
        },
        master_data: {
            en: 'Master and client data',
            ru: 'Данные мастера и клиента',
        },
        first_name: {
