            ru: 'Фамилия',
        },
        expert_full_name: {
            en: 'Name',
            ru: 'Имя',
        },
        client: {
            en: 'Client',
            ru: 'Клиент',
        },
        next: {
            en: 'Next',
            ru: 'Далее',
        },
    }
// const base_url = 'http://127.0.0.1:8000/api/'
const base_url = 'https://report.car-experts.ae/api/'
export default {
    name: "QuizNewView",
    data() {
        return {
            master: {
                name: '',
                lang: 'ru',
            },
            client: '',
            loader: false,
            next: false,

        }
    },

    mounted() {


    },

    methods: {

        tr(field) {
            if (translations[field])
                return translations[field][this.master.lang]
            else return field
        },
        createReport() {
            if(!(this.master.name &&
                this.client )) {
                alert('Заполните все данные')
                return;
            }
            this.loader = true;
            // Collect the data from the Vue data object
            const reportData = {
                master: {
                    name: this.master.name,
                    lang: this.master.lang
                },
                client: this.client,


            };

            // Send the data to the server using axios
            axios.post(base_url+'reports', reportData)
                .then(response => {
                    // Handle the response from the server
                    console.log(response.data);
                    this.$router.push({ name: 'quiz', params: { lang: response.data.master_lang, id: response.data.pseudo_id }});
                })
                .catch(error => {
                    this.loader = false;
                    alert('Произошла ошибка')
                    // Handle any errors that occurred during the request
                    console.error(error);
                });
        },

    },

